// SPDX-License-Identifier: MIT
pragma solidity ^0.5.16;

contract MyContract {
    struct Stock {
        uint256 price;
        string name;
        string symbol;
        string issuanceDate;
        string issuer;
    }

    mapping(string => Stock) public stocks;

    function updateStock(string calldata _symbol, uint256 _price, string calldata _name, string calldata _issuanceDate, string calldata _issuer) external {
        stocks[_symbol] = Stock(_price, _name, _symbol, _issuanceDate, _issuer);
    }

    function getStock(string calldata _symbol) external view returns (uint256, string memory, string memory, string memory) {
        Stock memory stock = stocks[_symbol];
        return (stock.price, stock.name, stock.issuanceDate, stock.issuer);
    }
}
